import { Component } from "react";

export default class Banner extends Component {
  componentDidMount() {}

  render() {
    return (
      <div>
        <div class="swiper-container">
          <div class="swiper-wrapper">
            <div class="swiper-slide">
              {[1, 2, 3, 4].map((key) => (
                <img
                  className={styles.img}
                  src={`/static/banner/banner${key}.png`}
                />
              ))}
            </div>
          </div>
        </div>
      </div>
    );
  }
}
